import React, { useState } from 'react';
import '../styles/SearchBar.css';
import CityFilter from './CityFilter';
import ColonyFilter from './ColonyFilter';
import PostalCodeFilter from './PostalCodeFilter';
import CategoryFilter from './CategoryFilter';
import ValuationFilter from './ValuationFilter';
import PriceRangeFilter from './PriceRangeFilter';

const SearchBar = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  const mockData = [
    { id: 1, name: 'Restaurant A', category: 'Food', city: 'Monterrey', colony: 'Colonia A', postalCode: '64000', valuation: 4, priceRange: [100, 300] },
    { id: 2, name: 'Hotel B', category: 'Accommodation', city: 'Guadalajara', colony: 'Colonia B', postalCode: '44100', valuation: 3, priceRange: [500, 1000] },
    { id: 3, name: 'Shop C', category: 'Shopping', city: 'Cancun', colony: 'Colonia C', postalCode: '77521', valuation: 5, priceRange: [50, 200] },
  ];

  const [cityFilter, setCityFilter] = useState('');
  const [colonyFilter, setColonyFilter] = useState('');
  const [postalCodeFilter, setPostalCodeFilter] = useState('');
  const [categoryFilter, setCategoryFilter] = useState('');
  const [valuationFilter, setValuationFilter] = useState('');
  const [priceRangeFilter, setPriceRangeFilter] = useState([0, Infinity]);

  const handleSearch = (event) => {
    const term = event.target.value;
    setSearchTerm(term);

    let results = mockData;

    if (cityFilter) {
      results = results.filter(item => item.city === cityFilter);
    }

    if (colonyFilter) {
      results = results.filter(item => item.colony.toLowerCase().includes(colonyFilter.toLowerCase()));
    }

    if (postalCodeFilter) {
      results = results.filter(item => item.postalCode === postalCodeFilter);
    }

    if (categoryFilter) {
      results = results.filter(item => item.category === categoryFilter);
    }

    if (valuationFilter) {
      results = results.filter(item => item.valuation === parseInt(valuationFilter));
    }

    results = results.filter(item => item.priceRange[0] >= priceRangeFilter[0] && item.priceRange[1] <= priceRangeFilter[1]);

    results = results.filter(item =>
      item.name.toLowerCase().includes(term.toLowerCase())
    );
    setSearchResults(results);
  };

  const handleCityFilterChange = (event) => {
    setCityFilter(event.target.value);
    handleSearch({ target: { value: searchTerm } }); // Trigger search with the current term
  };

  const handleColonyFilterChange = (event) => {
    setColonyFilter(event.target.value);
    handleSearch({ target: { value: searchTerm } });
  };

  const handlePostalCodeFilterChange = (event) => {
    setPostalCodeFilter(event.target.value);
    handleSearch({ target: { value: searchTerm } });
  };

  const handleCategoryFilterChange = (event) => {
    setCategoryFilter(event.target.value);
    handleSearch({ target: { value: searchTerm } });
  };

  const handleValuationFilterChange = (event) => {
    setValuationFilter(event.target.value);
    handleSearch({ target: { value: searchTerm } });
  };

  const handlePriceRangeFilterChange = (min, max) => {
    setPriceRangeFilter([min, max]);
    handleSearch({ target: { value: searchTerm } });
  };

  return (
    <div className="search-bar">
      <input
        type="text"
        className="search-input"
        placeholder="Busca lo mejor de la Gu√≠a"
        value={searchTerm}
        onChange={handleSearch}
      />
      <div className="filters">
        <CityFilter onChange={handleCityFilterChange} />
        <ColonyFilter onChange={handleColonyFilterChange} placeholder="üìç Ingresa la colonia" />
        <PostalCodeFilter onChange={handlePostalCodeFilterChange} placeholder="&#x1F52E; Ingresa el c√≥digo postal" />
        <CategoryFilter onChange={handleCategoryFilterChange} />
        <ValuationFilter onChange={handleValuationFilterChange} />
        <PriceRangeFilter onChange={handlePriceRangeFilterChange} />
      </div>
      <div className="buttons">
        <button onClick={handleApplyFilters}>Aplicar Filtros</button>
        <button onClick={handleCleanFilters}>Limpiar</button>
        <button onClick={handleSearchButton}>Buscar</button>
      </div>
      <ul>
        {searchResults.map(result => (
          <li key={result.id}>{result.name} ({result.category}) - {result.city} - {result.colony} - {result.postalCode} - {result.valuation} - {result.priceRange[0]} - {result.priceRange[1]}</li>
        ))}
      </ul>
    </div>
  );

  function handleApplyFilters() {
    handleSearch({ target: { value: searchTerm } });
  }

  function handleCleanFilters() {
    setCityFilter('');
    setColonyFilter('');
    setPostalCodeFilter('');
    setCategoryFilter('');
    setValuationFilter('');
    setPriceRangeFilter([0, Infinity]);
    handleSearch({ target: { value: searchTerm } });
  }

  function handleSearchButton() {
    // Simulate sending results to Directory page in a lightbox
    console.log('Resultados de la b√∫squeda:', searchResults);
  }
};

export default SearchBar;
